# Create Opcode onehot dictionary

import numpy as np
import json


opcode_index = {opcode_name: int(opcode_value) for opcode_value, opcode_name in integer_opcode.items()} # Mapping for each opcode decimal key as index 
Opcode_adj = np.zeros((256, 256)) # Create 256x256 zero matrix
for opcode_name, opcode_index in opcode_index.items():
    Opcode_adj[opcode_index][opcode_index] = 1

# Final opcode onehot vector output dictionary 
Opcode_onehot_dict = {opcode_name: ' '.join(str(int(bit)) for bit in Opcode_adj[opcode_index]) for opcode_name, opcode_index in opcode_index.items()}
file_path = "Opcode_Onehot_dictionary.txt"
with open(file_path, 'w') as file:
    file.write(f"Opcode Onehot vector dimension: {len(Opcode_onehot_dict)}\n")
